import React from "react";
import { NavLink } from "react-router-dom";

const Carddata = () => {
    return (
        <>
            <div className="container">
                <div className="row">
                    <div className="col-12 col-md-6">
                        <img className="carddata-image" src={process.env.PUBLIC_URL + "/Images/painting3.jpg"} alt="Random_Image" />
                    </div>
                    <div className="col-12 col-md-6">
                        <div>Rocking Lady 1 - Handpainted Art Painting - 32in X 32in</div>
                        <div>Size in Centimetres : 80 cm X 80 cm</div>
                        <div>Customizable : Yes</div>
                        <NavLink className to="">Community Artist Group</NavLink>
                        <div>MRP 657 <span>Inc. all taxes</span></div>
                        <div>Select a frame</div>
                        <NavLink className="" to="" >ADD To CART</NavLink>
                    </div>
                </div>
            </div>
        </>
    )
};

export default Carddata;
